import React from 'react'
import { Box, BottomNavigation, BottomNavigationAction, Paper } from "@material-ui/core"
import { AddCircleSharp, CreateSharp, SearchSharp, DeleteSharp } from "@material-ui/icons"



class Item extends React.Component {

  constructor(props) {
    super(props);
    this.state = {item : props.item};
}

  handleClickOpen = (item) => {
    console.log("Event !! before click : ", this.state.setOpen)
    this.setState({serOpen : true}, () =>{
        console.log('now opend : ', this.state.setOpen)
    })
  };

handleClose = () => {
    console.log("Event !! before click : ", this.state.setOpen)
    this.setState({serOpen : true}, () =>{
        console.log('now opend : ', this.state.setOpen)
    })
};

  render() {
    return (
      <Box>
        <Paper 
            style={{width : '100%', height : "70px" , position : 'absolute' , bottom : 0}}
            color = "red">
          <BottomNavigation
            style = {{justifyContent : "center"}}
            showLabels
          >
            <BottomNavigationAction
              label="제품 추가"
              icon={<AddCircleSharp />}
            />
            <BottomNavigationAction label="제품 검색" icon={<SearchSharp />} />
            <BottomNavigationAction label="제품 수정" icon={<CreateSharp />} />
            <BottomNavigationAction label="제품 삭제" icon={<DeleteSharp />} />
          </BottomNavigation>
        </Paper>
      </Box>
    );
  }
}

export default Item;
